t\': \'2018-07-06 17:04:21.969\'}, {\'hourseName\': \'星河湾盛荟园\', \'hourseType\': \'住宅\', \'buildYear\': \'2012年建成\', \'cityName\': \'广州\', \'ct\': \'2018-07-06 17:04:21.975\'}, {\'buildYear\': \'2004年建成\', \'cityName\': \'广州\', \'ct\': \'2018-07-06 17:04:21.950\', \'hourseName\': \'星河湾荟心园\', \'hourseType\': \'住宅\'}, {\'hourseName\': \'星河湾赏心园\', \'hourseType\': \'住宅\', \'buildYear\': \'2002年建成\', \'cityName\': \'广州\', \'ct\': \'2018-07-06 17:04:21.958\'}, {\'hourseName\': \'星河湾逸心园\', \'hourseType\': \'住宅\', \'buildYear\': \'2002年建成\', \'cityName\': \'广州\', \'ct\': \'2018-07-06 17:04:21.971\'}], \'allPages\': 1, \'currentPage\': 1, \'allNum\': 17, \'maxResult\': 20}}, \'teardown_hooks_start\': 1645717430.029867, \'teardown_hooks_duration\': 0}, \'validators\': []}}, {\'name\': \'聚合数据-笑话大全\', \'status\': \'success\', \'attachment\': \'\', \'meta_data\': {\'request\': {\'url\': \'http://v.juhe.cn/joke/content/list.php?sort=desc&page=1&pagesize=10&time=1600096122&key=e2ec0aecb1a2fc282f59b6fe961478e2\', \'method\': \'GET\', \'headers\': {\'User-Agent\': \'python-requests/2.22.0\', \'Accept-Encoding\': \'gzip, deflate\', \'Accept\': \'*/*\', \'Connection\': \'keep-alive\', \'Content-Type\': \'application/json;charset=utf-8\', \'userId\': \'var\', \'Content-Length\': \'2\'}, \'start_timestamp\': 1645717430.031102, \'setup_hooks_start\': 1645717430.0306509, \'setup_hooks_duration\': 0, \'json\': {}, \'verify\': False, \'params\': {\'sort\': \'desc\', \'page\': \'1\', \'pagesize\': \'10\', \'time\': \'1600096122\', \'key\': \'e2ec0aecb1a2fc282f59b6fe961478e2\'}, \'body\': \'{}\'}, \'response\': {\'status_code\': 200, \'headers\': {\'Connection\': \'close\', \'Transfer-Encoding\': \'chunked\', \'Content-Type\': \'application/json;charset=utf-8\', \'Date\': \'Thu, 24 Feb 2022 15:43:50 GMT\', \'Etag\': \'1c240e99837c678475a95f689a2de833\', \'Set-Cookie\': \'aliyungf_tc=7dc0f9697b6236825b893b64a06c5e727ab49c6e3d2f47b5ffac09285c45b3bc; Path=/; HttpOnly\'}, \'content_size\': 4736, \'response_time_ms\': 207.95, \'elapsed_ms\': 197.069, \'encoding\': \'utf-8\', \'content\': \'{\"reason\":\"Success\",\"result\":{\"data\":[{\"content\":\"某先生是地方上的要人。一天，他像往常一样在书房里例览当日报纸，突然对妻子大声喊道：喂，安娜，你看到今天早报上的流言蜚语了吗？真可笑！他们说，你收拾行装出走了。你听见了吗？安娜、你在哪儿？安娜？啊！\",\"hashId\":\"90B182FC7F74865B40B1E5807CFEBF41\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"有一天我看着报纸，小声嘟囔着一篇文章的题目鸟儿也有外语，丈夫听了对了一句：鸟儿当然也有‘外遇’。原来丈夫听错了，我笑得前仰后合。\",\"hashId\":\"206F5C52FD2ED94772CBC66C8AC61F2A\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"新提拔的经理觉得从员工中得到的尊重不够，于是一天戴上一枚自制的徽章，上面写着：“我是头儿！”然后在办公室神气地来回巡视。中午吃完饭后，经理回到办公室，看见桌上留着一张字条，上面写着：“你的妻子打来电话，说让你记着下班后把徽章带回去，她要用。”\",\"hashId\":\"B36BF69DC3B622BD8A4F5A7740C31806\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"每天最开心的事情就是早晨看着老婆抹了化妆水啪啪的拍自己的脸（据说是用来保湿的）。“啪啪”，“啪啪”，“啪啪”，听了太爽了，我边听边心里默念“叫你让我洗袜子，叫你让我接孩子，叫你不让我喝酒，叫你不叫我玩CS,打，打，给我使劲打！！”\",\"hashId\":\"844C822551A6D4B8352BDDE902F3034D\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"有一对新婚夫妇，彼此都不太了解，这个新娘有口臭而新郎呢，他有脚臭，但是彼此都不想让对方知道，因此在新婚后的一个月里新娘在晚上从来不开口说话，而新郎呢在一个月里都不脱袜子。但是一个月后的一天晚上，新郎不知怎的把袜子给睡掉了，当他醒来时发现袜子不见了他就找，把新娘给吵醒了，新娘问到你：你找什么我帮你找吧！新郎用手捂着鼻子说：呀，我找到了，原来我的袜子在你的嘴里。\",\"hashId\":\"CC93180C3C0BA4C291A2CF88B6A28A3A\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"今天周日，陪我逛商场去好么？啊，求你啊，老婆，上次累得我的腿还没缓过劲来呢。你不去逛商场，那就在家里洗衣服好么？洗就洗！！哎？哎？你怎么跟着我来了，不是不去商场么？-我是不放心，还是跟你着比较好。再说了，在卫生间里洗衣服和在里面吸烟是两回事呢。呵呵，那帮我拎着包好么？拎就拎吧，回来的比这重我也不是不知道。\",\"hashId\":\"AAFC436653D8520B9C3D6ECE1DBC6AA6\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"一天早晨，妻子正在厨房里安排早餐的时候，丈夫发现他的衣柜抽屉里只剩下一双干净的袜子了，他并没有发任何牢骚来责怪妻子洗衣不勤快，只是对着厨房大声说：“亲爱的，要是我还有一只脚，那它就会没有袜子穿了。”\",\"hashId\":\"1B596F6B3FF8787B29345A738477E62F\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"商人叮嘱老婆，如果他做生意赔了本，就把屋子弄得灯火通明，相反的话，则只是点一支蜡烛就行了。为什么这样呢？老婆不解地问。我赔了本，其他人该生气，他解释道，让他们生气的唯一方法就是让他们看到我家灯火通明。那你赚了钱呢？如果我赚了钱，那我当然要他们高兴，只点一支蜡烛，他们会认为我快要穷死了，一定会乐得跳起来！\",\"hashId\":\"EC3F5E40AA978568A273C01F24E27D19\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"妻子问我：“今天我生日，你给我买了什么礼物？”我笑着往对面一指：“看到那边那辆粉红色的奔驰了么？”“看到了！”她开心地回答。“我给你买了同样颜色的牙刷。”\",\"hashId\":\"BF43956476E9E2306A1C88DF329D59A9\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"有人问老陈：“听说你在公司是老虎，在家里却是一只柔顺的小猫咪.因为你怕老婆，是吗?”老陈回答道：“谁说的!我在家里也是老虎!敢小看我?没门!”这些话刚好被他老婆听见了，便破口大骂：“你是老虎，那我是谁？”老陈不好意思地说：“你~~~~你是武松呀！”\",\"hashId\":\"AF6A402659CF6F8785AD7488D01D98CC\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"}]},\"error_code\":0}\', \'content_type\': \'application/json;charset=utf-8\', \'ok\': True, \'url\': \'http://v.juhe.cn/joke/content/list.php?sort=desc&page=1&pagesize=10&time=1600096122&key=e2ec0aecb1a2fc282f59b6fe961478e2\', \'reason\': \'OK\', \'cookies\': {\'aliyungf_tc\': \'7dc0f9697b6236825b893b64a06c5e727ab49c6e3d2f47b5ffac09285c45b3bc\'}, \'text\': \'{\"reason\":\"Success\",\"result\":{\"data\":[{\"content\":\"某先生是地方上的要人。一天，他像往常一样在书房里例览当日报纸，突然对妻子大声喊道：喂，安娜，你看到今天早报上的流言蜚语了吗？真可笑！他们说，你收拾行装出走了。你听见了吗？安娜、你在哪儿？安娜？啊！\",\"hashId\":\"90B182FC7F74865B40B1E5807CFEBF41\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"有一天我看着报纸，小声嘟囔着一篇文章的题目鸟儿也有外语，丈夫听了对了一句：鸟儿当然也有‘外遇’。原来丈夫听错了，我笑得前仰后合。\",\"hashId\":\"206F5C52FD2ED94772CBC66C8AC61F2A\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"新提拔的经理觉得从员工中得到的尊重不够，于是一天戴上一枚自制的徽章，上面写着：“我是头儿！”然后在办公室神气地来回巡视。中午吃完饭后，经理回到办公室，看见桌上留着一张字条，上面写着：“你的妻子打来电话，说让你记着下班后把徽章带回去，她要用。”\",\"hashId\":\"B36BF69DC3B622BD8A4F5A7740C31806\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"每天最开心的事情就是早晨看着老婆抹了化妆水啪啪的拍自己的脸（据说是用来保湿的）。“啪啪”，“啪啪”，“啪啪”，听了太爽了，我边听边心里默念“叫你让我洗袜子，叫你让我接孩子，叫你不让我喝酒，叫你不叫我玩CS,打，打，给我使劲打！！”\",\"hashId\":\"844C822551A6D4B8352BDDE902F3034D\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"有一对新婚夫妇，彼此都不太了解，这个新娘有口臭而新郎呢，他有脚臭，但是彼此都不想让对方知道，因此在新婚后的一个月里新娘在晚上从来不开口说话，而新郎呢在一个月里都不脱袜子。但是一个月后的一天晚上，新郎不知怎的把袜子给睡掉了，当他醒来时发现袜子不见了他就找，把新娘给吵醒了，新娘问到你：你找什么我帮你找吧！新郎用手捂着鼻子说：呀，我找到了，原来我的袜子在你的嘴里。\",\"hashId\":\"CC93180C3C0BA4C291A2CF88B6A28A3A\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"今天周日，陪我逛商场去好么？啊，求你啊，老婆，上次累得我的腿还没缓过劲来呢。你不去逛商场，那就在家里洗衣服好么？洗就洗！！哎？哎？你怎么跟着我来了，不是不去商场么？-我是不放心，还是跟你着比较好。再说了，在卫生间里洗衣服和在里面吸烟是两回事呢。呵呵，那帮我拎着包好么？拎就拎吧，回来的比这重我也不是不知道。\",\"hashId\":\"AAFC436653D8520B9C3D6ECE1DBC6AA6\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"一天早晨，妻子正在厨房里安排早餐的时候，丈夫发现他的衣柜抽屉里只剩下一双干净的袜子了，他并没有发任何牢骚来责怪妻子洗衣不勤快，只是对着厨房大声说：“亲爱的，要是我还有一只脚，那它就会没有袜子穿了。”\",\"hashId\":\"1B596F6B3FF8787B29345A738477E62F\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"商人叮嘱老婆，如果他做生意赔了本，就把屋子弄得灯火通明，相反的话，则只是点一支蜡烛就行了。为什么这样呢？老婆不解地问。我赔了本，其他人该生气，他解释道，让他们生气的唯一方法就是让他们看到我家灯火通明。那你赚了钱呢？如果我赚了钱，那我当然要他们高兴，只点一支蜡烛，他们会认为我快要穷死了，一定会乐得跳起来！\",\"hashId\":\"EC3F5E40AA978568A273C01F24E27D19\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"妻子问我：“今天我生日，你给我买了什么礼物？”我笑着往对面一指：“看到那边那辆粉红色的奔驰了么？”“看到了！”她开心地回答。“我给你买了同样颜色的牙刷。”\",\"hashId\":\"BF43956476E9E2306A1C88DF329D59A9\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"有人问老陈：“听说你在公司是老虎，在家里却是一只柔顺的小猫咪.因为你怕老婆，是吗?”老陈回答道：“谁说的!我在家里也是老虎!敢小看我?没门!”这些话刚好被他老婆听见了，便破口大骂：“你是老虎，那我是谁？”老陈不好意思地说：“你~~~~你是武松呀！”\",\"hashId\":\"AF6A402659CF6F8785AD7488D01D98CC\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"}]},\"error_code\":0}\', \'json\': {\'reason\': \'Success\', \'result\': {\'data\': [{\'content\': \'某先生是地方上的要人。一天，他像往常一样在书房里例览当日报纸，突然对妻子大声喊道：喂，安娜，你看到今天早报上的流言蜚语了吗？真可笑！他们说，你收拾行装出走了。你听见了吗？安娜、你在哪儿？安娜？啊！\', \'hashId\': \'90B182FC7F74865B40B1E5807CFEBF41\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}, {\'content\': \'有一天我看着报纸，小声嘟囔着一篇文章的题目鸟儿也有外语，丈夫听了对了一句：鸟儿当然也有‘外遇’。原来丈夫听错了，我笑得前仰后合。\', \'hashId\': \'206F5C52FD2ED94772CBC66C8AC61F2A\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}, {\'content\': \'新提拔的经理觉得从员工中得到的尊重不够，于是一天戴上一枚自制的徽章，上面写着：“我是头儿！”然后在办公室神气地来回巡视。中午吃完饭后，经理回到办公室，看见桌上留着一张字条，上面写着：“你的妻子打来电话，说让你记着下班后把徽章带回去，她要用。”\', \'hashId\': \'B36BF69DC3B622BD8A4F5A7740C31806\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}, {\'content\': \'每天最开心的事情就是早晨看着老婆抹了化妆水啪啪的拍自己的脸（据说是用来保湿的）。“啪啪”，“啪啪”，“啪啪”，听了太爽了，我边听边心里默念“叫你让我洗袜子，叫你让我接孩子，叫你不让我喝酒，叫你不叫我玩CS,打，打，给我使劲打！！”\', \'hashId\': \'844C822551A6D4B8352BDDE902F3034D\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}, {\'content\': \'有一对新婚夫妇，彼此都不太了解，这个新娘有口臭而新郎呢，他有脚臭，但是彼此都不想让对方知道，因此在新婚后的一个月里新娘在晚上从来不开口说话，而新郎呢在一个月里都不脱袜子。但是一个月后的一天晚上，新郎不知怎的把袜子给睡掉了，当他醒来时发现袜子不见了他就找，把新娘给吵醒了，新娘问到你：你找什么我帮你找吧！新郎用手捂着鼻子说：呀，我找到了，原来我的袜子在你的嘴里。\', \'hashId\': \'CC93180C3C0BA4C291A2CF88B6A28A3A\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}, {\'content\': \'今天周日，陪我逛商场去好么？啊，求你啊，老婆，上次累得我的腿还没缓过劲来呢。你不去逛商场，那就在家里洗衣服好么？洗就洗！！哎？哎？你怎么跟着我来了，不是不去商场么？-我是不放心，还是跟你着比较好。再说了，在卫生间里洗衣服和在里面吸烟是两回事呢。呵呵，那帮我拎着包好么？拎就拎吧，回来的比这重我也不是不知道。\', \'hashId\': \'AAFC436653D8520B9C3D6ECE1DBC6AA6\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}, {\'content\': \'一天早晨，妻子正在厨房里安排早餐的时候，丈夫发现他的衣柜抽屉里只剩下一双干净的袜子了，他并没有发任何牢骚来责怪妻子洗衣不勤快，只是对着厨房大声说：“亲爱的，要是我还有一只脚，那它就会没有袜子穿了。”\', \'hashId\': \'1B596F6B3FF8787B29345A738477E62F\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}, {\'content\': \'商人叮嘱老婆，如果他做生意赔了本，就把屋子弄得灯火通明，相反的话，则只是点一支蜡烛就行了。为什么这样呢？老婆不解地问。我赔了本，其他人该生气，他解释道，让他们生气的唯一方法就是让他们看到我家灯火通明。那你赚了钱呢？如果我赚了钱，那我当然要他们高兴，只点一支蜡烛，他们会认为我快要穷死了，一定会乐得跳起来！\', \'hashId\': \'EC3F5E40AA978568A273C01F24E27D19\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}, {\'content\': \'妻子问我：“今天我生日，你给我买了什么礼物？”我笑着往对面一指：“看到那边那辆粉红色的奔驰了么？”“看到了！”她开心地回答。“我给你买了同样颜色的牙刷。”\', \'hashId\': \'BF43956476E9E2306A1C88DF329D59A9\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}, {\'content\': \'有人问老陈：“听说你在公司是老虎，在家里却是一只柔顺的小猫咪.因为你怕老婆，是吗?”老陈回答道：“谁说的!我在家里也是老虎!敢小看我?没门!”这些话刚好被他老婆听见了，便破口大骂：“你是老虎，那我是谁？”老陈不好意思地说：“你~~~~你是武松呀！”\', \'hashId\': \'AF6A402659CF6F8785AD7488D01D98CC\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}]}, \'error_code\': 0}, \'teardown_hooks_start\': 1645717430.2406569, \'teardown_hooks_duration\': 0}, \'validators\': [{\'check\': \'content.result.data.0\', \'expect\': {\'content\': \'某先生是地方上的要人。一天，他像往常一样在书房里例览当日报纸，突然对妻子大声喊道：喂，安娜，你看到今天早报上的流言蜚语了吗？真可笑！他们说，你收拾行装出走了。你听见了吗？安娜、你在哪儿？安娜？啊！\', \'hashId\': \'90B182FC7F74865B40B1E5807CFEBF41\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}, \'comparator\': \'equals\', \'desc\': \'\', \'check_value\': {\'content\': \'某先生是地方上的要人。一天，他像往常一样在书房里例览当日报纸，突然对妻子大声喊道：喂，安娜，你看到今天早报上的流言蜚语了吗？真可笑！他们说，你收拾行装出走了。你听见了吗？安娜、你在哪儿？安娜？啊！\', \'hashId\': \'90B182FC7F74865B40B1E5807CFEBF41\', \'unixtime\': 1418745227, \'updatetime\': \'2014-12-16 23:53:47\'}, \'check_result\': \'pass\'}, {\'check\': \'content.reason\', \'expect\': \'Success\', \'comparator\': \'equals\', \'desc\': \'\', \'check_value\': \'Success\', \'check_result\': \'pass\'}]}}, {\'name\': \'获取API列表-调用驱动函数获取token\', \'status\': \'failure\', \'attachment\': \'Traceback (most recent call last):\\n  File \"/Users/rikasai/code/python/FasterRunner/httprunner/api.py\", line 58, in test\\n    test_runner.run_test(teststep_dict)\\nhttprunner.exceptions.ExtractFailure: Failed to extract attribute from response body! => content.results.0.project\\nresponse body: {\\\'node\\\': [\\\'请填写合法的整数值。\\\']}\\n\\n\\nDuring handling of the above exception, another exception occurred:\\n\\nTraceback (most recent call last):\\n  File \"/Users/rikasai/code/python/FasterRunner/httprunner/api.py\", line 60, in test\\n    self.fail(str(ex))\\nAssertionError: Failed to extract attribute from response body! => content.results.0.project\\nresponse body: {\\\'node\\\': [\\\'请填写合法的整数值。\\\']}\\n\\n\', \'meta_data\': {\'request\': {\'url\': \'http://localhost:8000/api/fastrunner/api/?node=+&project=7&search=&tag=&rigEnv=\', \'method\': \'GET\