你记着下班后把徽章带回去，她要用。”\",\"hashId\":\"B36BF69DC3B622BD8A4F5A7740C31806\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"每天最开心的事情就是早晨看着老婆抹了化妆水啪啪的拍自己的脸（据说是用来保湿的）。“啪啪”，“啪啪”，“啪啪”，听了太爽了，我边听边心里默念“叫你让我洗袜子，叫你让我接孩子，叫你不让我喝酒，叫你不叫我玩CS,打，打，给我使劲打！！”\",\"hashId\":\"844C822551A6D4B8352BDDE902F3034D\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"有一对新婚夫妇，彼此都不太了解，这个新娘有口臭而新郎呢，他有脚臭，但是彼此都不想让对方知道，因此在新婚后的一个月里新娘在晚上从来不开口说话，而新郎呢在一个月里都不脱袜子。但是一个月后的一天晚上，新郎不知怎的把袜子给睡掉了，当他醒来时发现袜子不见了他就找，把新娘给吵醒了，新娘问到你：你找什么我帮你找吧！新郎用手捂着鼻子说：呀，我找到了，原来我的袜子在你的嘴里。\",\"hashId\":\"CC93180C3C0BA4C291A2CF88B6A28A3A\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"今天周日，陪我逛商场去好么？啊，求你啊，老婆，上次累得我的腿还没缓过劲来呢。你不去逛商场，那就在家里洗衣服好么？洗就洗！！哎？哎？你怎么跟着我来了，不是不去商场么？-我是不放心，还是跟你着比较好。再说了，在卫生间里洗衣服和在里面吸烟是两回事呢。呵呵，那帮我拎着包好么？拎就拎吧，回来的比这重我也不是不知道。\",\"hashId\":\"AAFC436653D8520B9C3D6ECE1DBC6AA6\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"一天早晨，妻子正在厨房里安排早餐的时候，丈夫发现他的衣柜抽屉里只剩下一双干净的袜子了，他并没有发任何牢骚来责怪妻子洗衣不勤快，只是对着厨房大声说：“亲爱的，要是我还有一只脚，那它就会没有袜子穿了。”\",\"hashId\":\"1B596F6B3FF8787B29345A738477E62F\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"商人叮嘱老婆，如果他做生意赔了本，就把屋子弄得灯火通明，相反的话，则只是点一支蜡烛就行了。为什么这样呢？老婆不解地问。我赔了本，其他人该生气，他解释道，让他们生气的唯一方法就是让他们看到我家灯火通明。那你赚了钱呢？如果我赚了钱，那我当然要他们高兴，只点一支蜡烛，他们会认为我快要穷死了，一定会乐得跳起来！\",\"hashId\":\"EC3F5E40AA978568A273C01F24E27D19\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"妻子问我：“今天我生日，你给我买了什么礼物？”我笑着往对面一指：“看到那边那辆粉红色的奔驰了么？”“看到了！”她开心地回答。“我给你买了同样颜色的牙刷。”\",\"hashId\":\"BF43956476E9E2306A1C88DF329D59A9\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"},{\"content\":\"有人问老陈：“听说你在公司是老虎，在家里却是一只柔顺的小猫咪.因为你怕老婆，是吗?”老陈回答道：“谁说的!我在家里也是老虎!敢小看我?没门!”这些话刚好被他老婆听见了，便破口大骂：“你是老虎，那我是谁？”老陈不好意思地说：“你~~~~你是武松呀！”\",\"hashId\":\"AF6A402659CF6F8785AD7488D01D98CC\",\"unixtime\":1418745227,\"updatetime\":\"2014-12-16 23:53:47\"}]},\"error_code\":0}\', \'content_type\': \'application/js